genome=""

def minimum_skew(genome):
    skew_list=[0]
    count=0
    for letter in genome:
        if letter=="C":
            count-=1
            skew_list.append(count)
        elif letter=="G":
            count+=1
            skew_list.append(count)
        else:
            skew_list.append(count)            
    pos_min_skew=[0]
    min_skew=min(skew_list)
    for i, skew in enumerate(skew_list):
        if skew==min_skew:
            pos_min_skew.append(i)
    return pos_min_skew
            
genome_min_skew=minimum_skew(genome)
print(*genome_min_skew)

